This example illustrates how a JWT Signing Key will be used from a .env file implicitly. Given an .env file like this: # .env
jwt_signing_key=123Secret123 The usage of jwt would look like this: curlz r -H 'Authorization: Bearer {{ jwt({"email": "john@dow.com", "sub": "some subject"}) }}' https://httpbin.org/headers Alternatively, you can provide the claims as named arguments like: curlz r -H 'Authorization: Bearer {{ jwt(email="john@dow.com", sub="some subject") }}' https://httpbin.org/headers { "headers": { "Accept": "*/*", "Authorization": "Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJleHAiOjE2Nzk1MjQ2ODAsInN1YiI6InNvbWUgc3ViamVjdCIsImVtYWlsIjoiam9obkBkb3cuY29tIiwiaWF0IjoxNjc5NTIzNzgwfQ.bt6taB1YGyMc_43mZeq77dgS_teyglUWtr1dsObyXTg", "Host": "httpbin.org", "User-Agent": "curl/7.86.0", "X-Amzn-Trace-Id": "Root=1-641b7fd7-65e24681239a404d6a143187" }
